def get_chn(word):
    # !/usr/bin/python
    # -*- coding:UTF-8 -*-

    # get_chn.py
    # Jun.12th
    # The English Description Service is provided by Youdao(NetEase, Inc).

    active = True
    p = -1
    s = ''
    while active:
        if word == 'q':
            active = False
            break
        else:
            html = 'http://dict.youdao.com/w/eng/{}/#keyfrom=dict2.index'.format(word)
            try:
                obj_html = requests.get(html)
                soup = BeautifulSoup(obj_html.text, 'lxml')
                _des = soup.find(class_='trans-container')('ul')[0]('li')
                for item in _des:
                    p = p + 1
                    des = item.text
                    ve = des.split()
                    if ve[0] == '[':
                        del _des[p]
                        continue
                    s = s + '\n' + item.text

                return s
            except Exception:
                return '[None]'


