def memorize():
    global d
    clear()
    error_mode = False
    with open(d, 'a+') as obj_dict:
        obj_dict.seek(0)
        words = obj_dict.read().splitlines()

    lim = len(words)
    print('Your dictionary has recorded {} word(s).\nYou can choose the number of the test personally.'.format(lim))
    print('\nTips: During the process, you can quit, show the answer or pass by entering _quit, _show & _pass\n')
    i = input('Set a number(enter 0 to check your last error(s)):')
    try:
        i = int(i)
    except Exception:
        print('Invalid Value!')
        clear()
        memorize()

    if i == 0:
        error_mode = True

    if i > lim or i < 0:
        print('Invalid Number!')
        clear()
        memorize()
    else:
        if error_mode:
            d = 'error_words.txt'
            rearrange()
            with open(d, 'a+') as obj_dict:
                obj_dict.seek(0)
                words = obj_dict.read().splitlines()
            i = len(words)
            if i == 0:
                print('You have no error last time.\n')
                os.system('pause')
                main()
        si = 0
        right = 0
        errors = []
        random.shuffle(words)
        for word in words[0:i]:
            clear()
            des = get_chn(word)
            print('=' * 40)
            print(des)
            ans = input('Your answer please:')
            if ans == word:
                right = right + 1
            elif ans == '_pass':
                errors.append(word)
                continue
            elif ans == '_show':  #
                errors.append(word)  #
                print(word + '\n')  # New function added (After I.P. 21.6.14)
                os.system('pause')  #
                continue  #
            elif ans == '_quit':
                clear()
                main()
            else:
                errors.append(word)
            si = si + 1
        clear()

        score = int((right / i) * 100)
        error = i - right
        print('=====================STAT=====================')
        print('Score:{}'.format(score))
        print('Right(s):{}'.format(right))
        print('Error(s):{}'.format(error))
        curr_time = time.strftime("%Y-%m-%d %H:%M:%S", time.localtime())
        record(curr_time, score, i, right, error, errors, error_mode)
        error_mode = False
        print('\n')
        os.system('pause')
        main()


def record(time, score, i, right, error, errors, err_m=False):
    error_words = '\n'
    if err_m:
        time = time + ' ' + '[Error Mode]'
    if errors == []:
        nn = '[None]'
        error_words = ''
        error_words = error_words + '\n' + '=' * 40
    else:
        nn = ''
        for e in errors:
            error_words = error_words + ' ' + e
        error_words = '\n' + '=' * 40 + error_words
    with open('record', 'a') as rec_obj:
        rec = '\n{} Your score:{}, Total:{}, Right:{}, Error:{}'.format(time, score, i, right, nn)
        rec_obj.writelines(error_words)
        rec_obj.writelines(rec)
    with open('error_words.txt', 'w+') as ew_obj:
        for e in errors:
            ew_obj.writelines(e + '\n')


